import React, { useState } from "react";
import SearchBar from "./SearchBar";
import "./Navbar.css";
import EcoEcho from "../Fotos/EcoEcho.png";
import { Link } from "react-router-dom";
import { useAuth0 } from "@auth0/auth0-react";
import Login from "./Login/Login";
import LogoutButton from "./Login/LogoutButton";

export default function Navbar() {
 
  const { isAuthenticated } = useAuth0();

  return (
    <header>
      <link
        href="https://fonts.googleapis.com/css2?family=Raleway:wght@400;700&display=swap"
        rel="stylesheet"
      ></link>
      <div className="logo"></div>
      <Link to="/">
        <img
          className="logoeco"
          src={EcoEcho}
          alt="EcoEcho"
          width="90"
          height="90"
        ></img>
      </Link>
      <div className="SearchBar">
        <SearchBar />
      </div>
      <h2 className="text-nav">EcoEcho - ecological products </h2>
      <div>

      {isAuthenticated ?
              (
                <>
                  <Link to="/userprofile" className="d-flex text-reset align-items-center justify-content-center m-0 p-0 text-decoration-none border border-0 bg-transparent me-5" >Hello, {userInfo.fullname}</Link>
                  <LogoutButton />
                </>
              ) :
              (
                <>
                  <LoginButton />
                  <SignupButton />
                </>
              )
            }
     
</div>
    </header>
  );
}
